@gò
- 1 d. Khoảng đất nổi cao lên giữa nơi bằng phẳng. Cánh đồng có nhiều gò.
- 2 đg. 1 Làm biến dạng tấm kim loại, thường bằng phương pháp thủ công, để tạo thành vật gì đó. Gò thùng tôn. Thợ gò. 2 Ép vào một khuôn khổ nhất định. Văn viết gò từng câu, từng chữ, không tự nhiên. Cố gò mấy con số để đưa vào báo cáo thành tích. 3 Kéo mạnh một đầu dây cương, dây thừng và giữ thẳng dây để ghìm ngựa hay gia súc lại hoặc bắt phải đi thẳng theo một hướng nhất định. Gò ngựa dừng lại. Gò thừng cho bò đi thẳng đường. 4 Tự ép mình ở một tư thế nhất định, không được tự nhiên, thoải mái, thường cong lưng lại, để tiện dùng sức tập trung vào một việc gì. Gò lưng đạp xe lên dốc. Con trâu gò lưng kéo cày. Người gò lại vì đau.
